import React from "react";

const cat1 = require('../images/alimentacao.png');
const cat2 = require('../images/cat2.jpg');
const cat3 = require('../images/cat3.jpg');
const cat4 = require('../images/cat4.jpg');
const cat5 = require('../images/cat5.jpg');

function Home() {
    return (
    <div>

        
            <div class="row">
                <div class="col-md-8">ALIMENTAÇÃO
                    <div class="card" style="width: 18rem;">
                    <img src={cat1} class="card-img-top" alt="..."/>
                    </div>

                </div>
                <div class="col-6 col-md-4">TECNOLOGIA</div>
            </div>

            <div class="row">
                <div class="col-6 col-md-4">VESTUÁRIO</div>
                <div class="col-6 col-md-4">CASA</div>
                <div class="col-6 col-md-4">ANIMAIS</div>
            </div>


            <div class="row">
                <div class="col-6">DESPORTO</div>
                <div class="col-6">JARDIM</div>
            </div>
        </div>
        
    );
}

export default Home;
